import React from 'react';
import CategoryListItem from './CategoryListItem';
import '../../scss/browse_page/browse_page.scss';

export default function CategoryList(props) {
  const selectCategory = props.selectCategory;
  const categoryItems = props.genreList.map((genre) => (
    <CategoryListItem key={genre.id} id={genre.id} name={genre.name} selectCategory={selectCategory} />
  ));
  return (
    <>
      <div className="bottom-border pb-2">
        <p>Filters</p>
      </div>
      <div className="mt-3">{categoryItems}</div>
    </>
  );
}
